Mongoose not returning anything hanging until connection timesout<p>My login script was working fine but only for one record, all the rest hang and do not return not quite sure why?</p>
<p>It reutrns the email and password from my console.log but not the console.log of the user. Also can confirm that the users email does exist in the db</p>
<p>Below is my basic setup.</p>
<p>User model</p>
<pre><code>var mongoose = require(&quot;mongoose&quot;);
var bcrypt = require(&quot;bcrypt&quot;);
var passwordString = require(&quot;../helper/generateStrongRandomString&quot;);

var schema = new mongoose.Schema(
  {
    email: {
      type: String,
      required: true,
      unique: true,
      validate: {
        validator: function (v) {
          return /^([a-zA-Z0-9_\-\.]+)@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.)|(([a-zA-Z0-9\-]+\.)+))([a-zA-Z]{2,4}|[0-9]{1,3})(\]?)$/.test(
            v
          );
        },
        message: (props) =&gt; `${props.value} is not a valid email address`,
      },
    },
    organisation: {
      ref: &quot;organisation&quot;,
      type: mongoose.Schema.Types.ObjectId,
      required: true,
    },
    client: {
      ref: &quot;client&quot;,
      type: mongoose.Schema.Types.ObjectId,
      required: false,
    },
    forename: {
      type: String,
    },
    surname: {
      type: String,
    },
    password: {
      type: String,
      default: null,
    },
    created: {
      type: Date,
      default: Date.now(),
    },
    updated: {
      type: Date,
      default: null,
    },
    passwordResetString: {
      type: String,
      default: null,
    },
  },
  {
    toJSON: { virtuals: true },
    toObject: { virtuals: true },
  }
);

schema.pre(&quot;save&quot;, function (next) {
  var user = this;

  if (!user.isNew) {
    user.updated = Date.now();
  }

  if (user.isNew &amp;&amp; !user.password) {
    user.passwordResetString = passwordString();
  }

  if (!user.isModified(&quot;password&quot;)) {
    return next();
  }

  bcrypt
    .hash(user.password, 12)
    .then((hash) =&gt; {
      user.password = hash;
      next();
    })
    .catch((err) =&gt; console.log(err));
});

schema.pre(&quot;save&quot;, function (next) {
  var user = this;
  user.updated = Date.now();
  next();
});

function autopopulate(next) {
  this.populate(&quot;organisation&quot;);
  this.populate(&quot;client&quot;);
  next();
}

schema.pre(&quot;find&quot;, autopopulate);
schema.pre(&quot;findOne&quot;, autopopulate);

var User = new mongoose.model(&quot;user&quot;, schema);

module.exports = User;

</code></pre>
<p>Login route</p>
<pre><code>const router = require(&quot;express&quot;).Router();

const passport = require(&quot;passport&quot;);

const catchErrors = require(&quot;../middlewares/catchErrors&quot;);

router.post(
  &quot;/login&quot;,
  passport.authenticate(&quot;local&quot;),
  catchErrors(async (req, res) =&gt; {
    console.log(req.body);
    // console.log(req);
  })
);

module.exports = router;
</code></pre>
<p>Passport js local authentication</p>
<pre><code>passport.use(
  new LocalStrategy(
    {
      usernameField: &quot;email&quot;,
      passwordField: &quot;password&quot;,
    },
    async function (email, password, cb) {
      console.log(email, password);
      return User.findOne({ email })
        .then((user) =&gt; {
          console.log(user);
          if (!user || !bcrypt.compareSync(password, user.password)) {
            console.log(26);
            return cb(null, false, {
              message: &quot;incorrect email or password&quot;,
            });
          }
          return cb(null, user, {
            message: &quot;Logged in successfully&quot;,
          });
        })
        .catch((err) =&gt; console.log(err));
    }
  )
);
</code></pre>

