How to filter a nested array in mongoose in a findOne without the nested object being required<p>I have a collection called elections and in the elections schema there's a nested array called votes. I'm trying to query an election by id as well as filter the nested votes objects by a <code>userId</code> property. I want the parent election object to always be returned and if the current user hasn't voted in the election the <code>votes</code> property should be an empty array.</p>
<p>This is my query:</p>
<pre class="lang-js prettyprint-override"><code>Election.findOne({
    _id: electionId,
    'votes.userId': userId
})
.exec()
</code></pre>
<p>The issue is that if there aren't any votes with the <code>userId</code> the parent Election object isn't returned as well. Is there any way to filter the <code>votes</code> property but also make it not-required for matching the parent election object.</p>
<p>I come from a background in sql and in the Sequelize here is how I'd do what I want to do:</p>
<pre class="lang-js prettyprint-override"><code>models.Election.findOne({
    where: {
        id: electionId
    }
    include: {
        model: models.Vote,
        where: {
            userId
        },
        required: false
    }
})
</code></pre>

