Wrong implementation of $lookup from MongoDB in NodeJs<p>I have an <code>Entity</code> model and a <code>Review</code> model, they are related by <code>entityId</code> field which is part <code>Review</code> model.</p>
<p>I am trying to find all the reviews from a specific <code>entity</code> and then calculate the average of all the rating of all reviews. (<code>rating</code> is another field of <code>Review</code> model, given below)</p>
<p>This is how <code>Entity</code> model looks:</p>
<pre><code>
const entitySchema = new Schema({
  name: {
    type: String,
    required: true,
    trim: true,
    unique: true,
  }
});
</code></pre>
<p>and this is <code>Review</code> model:</p>
<pre><code>const reviewSchema = new Schema({
  rating: {
    type: Number,
    min: 0,
    max: 5,
    required: true,
  },
  comment: {
    type: String,
    trim: true,
  },
  public: {
    type: Boolean,
    required: true,
    default: false,
  },
  entityId: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Entity',
    required: true,
  }
}, {
  timestamps: true,
});
</code></pre>
<p><strong>I want to <code>$lookup</code> function here and this is what I have tried till now:</strong></p>
<pre><code>router.get('/entities/reviews/average', async (req, res) =&gt; {
  try {
    const entity = await Entity.find();
    const entityId = [];
    Object.keys(entity).forEach((key) =&gt; {
      entityId.push(entity[key]._id);
    });
    Object.keys(entityId).forEach((key) =&gt; {
      const reviews = Review.aggregate([
        { $match: { entityId: ObjectId(entityId[key]) } },
        {
          $lookup: {
            from: 'entity',
            localField: '_id',
            foriegnField: 'entityId',
            as: 'rating',
          },
        },
        {
          $group: {
            _id: null,
            avg: { $avg: '$rating' },
          },
        },
      ]);
      res.send(reviews);
    });
  } catch (e) {
    res.status(500).send();
  }
});
</code></pre>
<p>But this doesn't work it gives this response back</p>
<pre><code>{
    &quot;_pipeline&quot;: [
        {
            &quot;$match&quot;: {
                &quot;entityId&quot;: &quot;5eb658d7&quot;
            }
        },
        {
            &quot;$lookup&quot;: {
                &quot;from&quot;: &quot;entity&quot;,
                &quot;localField&quot;: &quot;_id&quot;,
                &quot;foriegnField&quot;: &quot;entityId&quot;,
                &quot;as&quot;: &quot;rating&quot;
            }
        },
        {
            &quot;$group&quot;: {
                &quot;_id&quot;: null,
                &quot;avg&quot;: {
                    &quot;$avg&quot;: &quot;$rating&quot;
                }
            }
        }
    ],
    &quot;options&quot;: {}
}
</code></pre>
<p>How to do this? What am I doing wrong?</p>

