Add a deeply embedded document conditionally if unique field value<p>I have following model and schemas in mongoose :</p>
<pre class="lang-js prettyprint-override"><code>const Doc = mongoose.model(
  &quot;Doc&quot;,
  new mongoose.Schema({
    name: String,
    subDocs: [SubDoc],
  })
);

const SubDoc = new mongoose.Schema({
  name: String,
  subSubDocs: [SubSubDoc],
});

const SubSubDoc = new mongoose.Schema({
  name: String,
});
</code></pre>
<p>This code adds a uniquely named embedded <code>SubDoc</code> to the parent <code>Doc</code>. By &quot;uniquely named&quot; I mean it will not create a subdocument if another subdocument in the parent has the same value for &quot;name&quot;:</p>
<pre class="lang-js prettyprint-override"><code>
const createUniqueSubDoc = (docId, name) =&gt; {
  return db.Doc.findOneAndUpdate(
    { _id: docId, &quot;subDocs.name&quot;: { $ne: name } },
