<p>I want to add another condition that it should return only those responses in which <code>public</code> is set to <code>true</code>.</p>
<p>I tried to use <code>$filter</code>but did not work.</p>
<p>How to do this?</p>; Answer: This fine morning I encountered the problem again. My Homestead box was aborted, and on startup the problem was back again. This time I solved it quicker. The solution seems to be to add `extension=grpc.so` to the php.ini file for php-fpm. Then I restarted php-fpm and voil, problem solved.

