Mongo query incorrect unless $and is used, when is $and required<p>A Mongo query that uses two clauses is that was not working properly.  It follows this pattern:</p>
<pre><code>var aDate = ISODate(&quot;2020-09-09T16:50:00.000Z&quot;);
db.col.find({
    $or: [ { deletedBy: 'joe', markedBy: 'joe' } ],
    $or: [ { deletedOn: {$lte: aDate}, markedOn: {$lte: aDate} ]
    })
</code></pre>
<p>This should return documents where the field <code>deletedBy or markedBy contains 'joe'</code> AND <code>the field deletedOn or markedOn is less than or equal to the aDate</code> variable.</p>
<p>My belief was that mongo treats multiple fields using the <code>AND</code> operator so <code>{a:1,b:2}</code> would be true only if both <code>a == 1</code> and <code>b == 2</code>.  This is how the mongo docs describe it.  See <a href="https://docs.mongodb.com/manual/reference/method/db.collection.find/#query-for-multiple-conditions" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/method/db.collection.find/#query-for-multiple-conditions</a>.</p>
<p>When I changed the query to to explicitly state the <code>$and</code> operator, the query produced the correct results.</p>
<pre><code>var aDate = ISODate(&quot;2020-09-09T16:50:00.000Z&quot;);
db.col.find({
    $and: [ { $or: [ { deletedBy: 'joe', markedBy: 'joe' } ] },
            { $or: [ { deletedOn: {$lte: aDate}, markedOn: {$lte: aDate} ] }
          ]
    })
</code></pre>
<p>I proved the query was producing the incorrect results using some debug print statements as shown below.  I tested this with each of the queries I've shown above.</p>
<pre><code>var aDate = ISODate(&quot;2020-09-09T16:50:00.000Z&quot;);
db.col.find({
    $or: [ { deletedBy: 'joe', markedBy: 'joe' } ],
    $or: [ { deletedOn: {$lte: aDate}, markedOn: {$lte: aDate} ]
    })
    .forEach(function(doc) {
        if (doc.deletedBy &amp;&amp; doc.deletedBy !== 'joe') {
            print('deletedBy not set to joe.  deletedBy=' + doc.deletedBy + ', markedBy: ' + doc.markedBy);
        }
        if (doc.markedBy &amp;&amp; doc.markedBy!== 'joe') {
            print('markedBy not set to joe.  markedBy =' + doc.markedBy + ', markedBy: ' + doc.markedBy);
        }

        if (doc.deletedOn &amp;&amp; doc.deletedOn &gt; aDate) {
            print('deletedOn check: deletedOn=' + doc.deletedOn + ', markedOn=' + doc.markedOn);
        }

        if (doc.markedOn&amp;&amp; doc.markedOn&gt; aDate) {
            print('markedOncheck: markedOn=' + doc.markedOn+ ', deletedOn =' + doc.deletedOn );
        }
    });
</code></pre>
<p>The print statements would print docs that showed deletedBy was a value other than 'joe'.  For example,</p>
<pre><code>deletedBy not set to joe.  deletedBy=sally, markedBy: undefined
deletedBy not set to joe.  deletedBy=mark, markedBy: undefined
</code></pre>
<p>But these print statements would not appear when I used the <code>$and</code> operator!</p>
<p>So my question is: <strong>When MUST I use the <code>AND</code> operator to get the correct query results and where is it documented?</strong></p>
<p><strong>Below are things I found when searching for an answer</strong></p>
<ul>
<li><p>I did searches but this just confirmed that my understanding is correct and I have no idea why I needed to add the $and operator was needed (in my case).  See <a href="https://docs.mongodb.com/manual/reference/operator/query/and/index.html" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/operator/query/and/index.html</a> which says:</p>
<p><strong>NOTE: MongoDB provides an implicit AND operation when specifying a comma separated list of expressions.</strong></p>
</li>
<li><p>See also: <a href="https://stackoverflow.com/questions/26856062/mongo-db-query-with-and">Mongo db query with and</a> which is really a different question.</p>
</li>
</ul>

